data.value:
Określ zestaw znaków dozwolonych w kodzie PIN na poziomie aplikacji.

Numeryczne — dozwolone będą tylko proste cyfry 0-9;

Alfanumeryczne — dozwolone będzie użycie kombinacji cyfr i liter alfabetu A-Z;

Alfanumeryczne i symbole — dozwolona będzie kombinacja cyfr, liter alfabetu i/lub znaków specjalnych.

